import React from 'react';
import { Link } from 'react-router-dom';

function MainPage() {
  return (
    <div>
      <h1>Main Page</h1>
      {/* Link to the SignIn page */}
      <Link to="/signin">Go to Sign In</Link>
    </div>
  );
}

export default MainPage;
